// AssertKafkaDataCentreV2Required checks if the required fields are not zero-ed
func AssertKafkaDataCentreV2Required(obj KafkaDataCentreV2) error {
	elements := map[string]interface{}{
		"numberOfNodes": obj.NumberOfNodes,
		"network":       obj.Network,
		"nodeSize":      obj.NodeSize,
		"cloudProvider": obj.CloudProvider,
		"name":          obj.Name,
		"region":        obj.Region,
	}
	for name, el := range elements {
		if isZero := IsZeroValue(el); isZero {
			return &RequiredError{Field: name}
		}
	}

	for _, el := range obj.AwsSettings {
		if err := AssertProviderAwsSettingsV2Required(el); err != nil {
			return err
		}
	}
	for _, el := range obj.Tags {
		if err := AssertProviderTagV2Required(el); err != nil {
			return err
		}
	}
	for _, el := range obj.GcpSettings {
		if err := AssertProviderGcpSettingsV2Required(el); err != nil {
			return err
		}
	}
	for _, el := range obj.Nodes {
		if err := AssertNodeDetailsV2Required(el); err != nil {
			return err
		}
	}
	for _, el := range obj.AzureSettings {
		if err := AssertProviderAzureSettingsV2Required(el); err != nil {
			return err
		}
	}
	for _, el := range obj.PrivateLink {
		if err := AssertPrivateLinkSettingsV2Required(el); err != nil {
			return err
		}
	}
	return nil
}

// AssertRecurseKafkaDataCentreV2Required recursively checks if required fields are not zero-ed in a nested slice.
// Accepts only nested slice of KafkaDataCentreV2 (e.g. [][]KafkaDataCentreV2), otherwise ErrTypeAssertionError is thrown.
func AssertRecurseKafkaDataCentreV2Required(objSlice interface{}) error {
	return AssertRecurseInterfaceRequired(objSlice, func(obj interface{}) error {
		aKafkaDataCentreV2, ok := obj.(KafkaDataCentreV2)
		if !ok {
			return ErrTypeAssertionError
		}
		return AssertKafkaDataCentreV2Required(aKafkaDataCentreV2)
	})
}
